import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import StoryIntro from '../components/StoryIntro';

const API_BASE_URL = 'http://localhost:8081';

export default function Adventure() {
  const [formData, setFormData] = useState({
    adventurer_name: '',
    gender: ''
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [showStory, setShowStory] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    // Check if user has an existing profile
    const checkProfile = async () => {
      try {
        const user = JSON.parse(localStorage.getItem('user'));
        if (!user || !user.id) {
          setError('User not found. Please log in again.');
          setLoading(false);
          return;
        }

        const response = await axios.get(`${API_BASE_URL}/api/adventure-profile?userId=${user.id}`, {
          withCredentials: true
        });
        
        if (response.data) {
          navigate('/map');
        }
      } catch (err) {
        if (err.response?.status !== 404) {
          setError('Error checking profile status: ' + (err.response?.data || err.message));
        }
      } finally {
        setLoading(false);
      }
    };

    checkProfile();
  }, [navigate]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    
    try {
      const user = JSON.parse(localStorage.getItem('user'));
      if (!user || !user.id) {
        setError('User not found. Please log in again.');
        return;
      }

      const response = await axios.post(`${API_BASE_URL}/api/adventure-profile`, {
        ...formData,
        user_id: user.id
      }, {
        withCredentials: true,
        headers: {
          'Content-Type': 'application/json'
        }
      });

      if (response.data) {
        setShowStory(true);
      }
    } catch (err) {
      setError('Failed to create profile: ' + (err.response?.data || err.message));
    }
  };

  if (loading) {
    return (
      <div style={{ padding: '2rem', textAlign: 'center' }}>
        <h2>Loading...</h2>
      </div>
    );
  }

  if (showStory) {
    return <StoryIntro onComplete={() => navigate('/map')} />;
  }

  return (
    <div style={{ padding: '2rem', maxWidth: '600px', margin: '0 auto' }}>
      <h1>Create Your Adventure Profile</h1>
      {error && (
        <div style={{ color: 'red', marginBottom: '1rem', padding: '1rem', backgroundColor: 'rgba(255,0,0,0.1)', borderRadius: '4px' }}>
          {error}
        </div>
      )}
      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem' }}>
            Adventurer Name:
            <input
              type="text"
              name="adventurer_name"
              value={formData.adventurer_name}
              onChange={handleChange}
              required
              style={{ width: '100%', padding: '0.5rem' }}
            />
          </label>
        </div>
        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem' }}>
            Gender:
            <select
              name="gender"
              value={formData.gender}
              onChange={handleChange}
              required
              style={{ width: '100%', padding: '0.5rem' }}
            >
              <option value="">Select gender</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
              <option value="other">Other</option>
            </select>
          </label>
        </div>
        <button
          type="submit"
          style={{
            padding: '0.5rem 1rem',
            backgroundColor: '#4CAF50',
            color: 'white',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Start Adventure
        </button>
      </form>
    </div>
  );
}
